import React from 'react';
import './DustCard.css';

const DustCard = ({ dust }) => (
  <div className="dust-card">
    <h3>미세먼지 정보</h3>
    <p>미세먼지: {dust.pm10.grade} <strong>{dust.pm10.value} µg/m³</strong></p>
    <p>초미세먼지: {dust.pm25.grade} <strong>{dust.pm25.value} µg/m³</strong></p>
  </div>
);

export default DustCard;
